-- DDL
-- Strong Entity

CREATE TABLE RESTAURANT -- len = 500
(
    Restaurant_id	     NUMBER(10),
    Location	         VARCHAR(200),
    Name	             VARCHAR(50),
    PRIMARY KEY(Restaurant_id)
);

CREATE SEQUENCE restaurant_seq START WITH 500 INCREMENT BY 1 NOCYCLE;

CREATE TABLE USER_INFO -- len = 500
(
    User_id             NUMBER,
    Login_id          VARCHAR(40) UNIQUE NOT NULL,
    Password          VARCHAR(40) NOT NULL,
    Nick_name	        VARCHAR(20),
    Messenger_link	    VARCHAR(30),
    Point	            NUMBER DEFAULT 0,
    PRIMARY KEY(User_id)
);

CREATE SEQUENCE user_id_seq START WITH 500 INCREMENT BY 1 NOCYCLE;

CREATE TABLE MENU    -- len = 2000
(
    Menu_id            NUMBER,
    Restaurant_id      NUMBER, -- FK
    Name               VARCHAR(100),
    Price              NUMBER,
    PRIMARY KEY(Menu_id)
);

CREATE SEQUENCE menu_seq START WITH 2000 INCREMENT BY 1 NOCYCLE;

CREATE TABLE USER_REVIEW -- len = 600
(
    User_review_id    NUMBER,
    Score             NUMBER(1),
    Description       VARCHAR(200),
    Reviewee_id        NUMBER, -- FK
    Reviewer_id        NUMBER,  -- FK
    Reservation_id    NUMBER, -- FK
    PRIMARY KEY(User_review_id)
);

CREATE SEQUENCE user_review_seq START WITH 600 INCREMENT BY 1 NOCYCLE;

CREATE TABLE RESTAURANT_REVIEW -- len = 600
(
    Restaurant_review_id    NUMBER,
    Score                   NUMBER(1),
    Description             VARCHAR(200),
    Restaurant_id           NUMBER(10), -- FK
    -- Participant_id          NUMBER, -- FK
    User_id                  NUMBER,
    PRIMARY KEY(Restaurant_review_id)
);

CREATE SEQUENCE restaurant_review_seq START WITH 600 INCREMENT BY 1 NOCYCLE;

CREATE TABLE PARTICIPANT -- len = 1000
(
    Participant_id    NUMBER,
    Role              VARCHAR(10) CHECK (Role = 'HOST' OR Role = 'GUEST'),
    Participation     NUMBER(1) CHECK (Participation = 0 OR Participation = 1),
    User_id           NUMBER, -- FK
    Reservation_id    NUMBER, -- FK
    PRIMARY KEY(Participant_id)
);

CREATE SEQUENCE participant_seq START WITH 1000 INCREMENT BY 1 NOCYCLE;

CREATE TABLE RESERVATION -- len = 200
(
  Reservation_id        NUMBER,
  Date_time             TIMESTAMP,
  Description           VARCHAR(200),
  Penalty_price         NUMBER(6),
  Finished              Number(1) CHECK (Finished = 0 OR Finished = 1),
  Restaurant_id         NUMBER(10), -- FK
  PRIMARY KEY(Reservation_id)
);

CREATE SEQUENCE reservation_seq START WITH 200 INCREMENT BY 1 NOCYCLE;


-- FOREIGN KEY CONSTRAINT

-- USER REVIEW
ALTER TABLE USER_REVIEW ADD FOREIGN KEY (Reviewee_id) REFERENCES USER_INFO(User_id) ON DELETE CASCADE;
ALTER TABLE USER_REVIEW ADD FOREIGN KEY (Reviewer_id) REFERENCES USER_INFO(User_id) ON DELETE CASCADE;
ALTER TABLE USER_REVIEW ADD FOREIGN KEY (Reservation_id) REFERENCES RESERVATION(Reservation_id) ON DELETE CASCADE;

-- PARTICIPANT
ALTER TABLE PARTICIPANT ADD FOREIGN KEY (User_id) REFERENCES USER_INFO(User_id) ON DELETE CASCADE;
ALTER TABLE PARTICIPANT ADD FOREIGN KEY (Reservation_id) REFERENCES RESERVATION(Reservation_id) ON DELETE CASCADE;  
  
-- RESERVATION
ALTER TABLE RESERVATION ADD FOREIGN KEY (Restaurant_id) REFERENCES RESTAURANT(Restaurant_id) ON DELETE CASCADE; 

-- MENU
ALTER TABLE MENU ADD FOREIGN KEY (Restaurant_id) REFERENCES RESTAURANT(Restaurant_id) ON DELETE CASCADE;

-- RESTAURANT REVIEW
ALTER TABLE RESTAURANT_REVIEW ADD FOREIGN KEY (Restaurant_id) REFERENCES RESTAURANT(Restaurant_id) ON DELETE CASCADE;
-- ALTER TABLE RESTAURANT_REVIEW ADD FOREIGN KEY (Participant_id) REFERENCES PARTICIPANT(Participant_id) ON DELETE CASCADE;
